import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";

const FormBar = ({ name, label, icon }) => {
  return (
    <a>
      <span>{name}</span>
      <span className="icon">
        <FontAwesomeIcon icon={icon} />
      </span>
      <span className="download">{label}</span>
    </a>
  );
};

export default FormBar;
